        age:25,
        username:'sanj31'
      },
    {
      name:'mansih',
      age:25,
      username:'manish34'
    }],
    };
  }
  render() {
    return (
      <div>
        {/* <ul>
          {this.state.list.map(item => (
            <li key={item}>{item}</li>
          ))}
        </ul> */}

        <p>{this.state.name}</p>
      <p>{this.state.age}</p>
      </div>
    );
  }
}
export default App;
